import React from "react";
import "../../../Styles/Pages/Home/LandingFifth.scss";
import FifthCard from "../../Shared/FifthCard";
import { fifthList1, fifthList2 } from "./payingList";

function LandingFifth({ displayRow2 }) {
  return (
    <div className='landingFifth'>
      <div className='landingFifth__title'>
        <h2>Achieve Cross-Border Growth</h2>
        <p>
          Pay2Gate is an all-in-one global monetization platform, we've made
          buying easy for customers all over the world by offering them a
          payment method they prefer. With our over 450 payment methods, we help
          businesses grow in new markets.
        </p>
      </div>
      <div className='landingFifth__row'>
        {fifthList1.map((item, key) => {
          return (
            <FifthCard
              img={item.img}
              title={item.title}
              paragraf={item.paragraf}
              key={key}
            />
          );
        })}
      </div>
      <div className='landingFifth__row' style={{ display: `${displayRow2}` }}>
        {fifthList2.map((item, key) => {
          return (
            <FifthCard
              img={item.img}
              title={item.title}
              paragraf={item.paragraf}
              key={key}
            />
          );
        })}
      </div>
    </div>
  );
}

export default LandingFifth;
